import { render } from '@testing-library/react';
import React from 'react';
import profile from './profile-picture.png'
const Signup = () => {
  render(); {
    return (

      <div className="container">

        <img
          className="profile-picture"
          id="profile-picture"
          src={profile}
          alt=""
        ></img>
        <main className="container-login">

          <form>
            <h2>Criar conta</h2>
            <div className="input-field">
              
              <input name="name" id="name" placeholder="Insira seu bome" type="text"/>
              <div className="underline"></div>

              <input name="email" id="email" placeholder="Insira seu email" type="text"/>
              <div className="underline"></div>

            </div>
            <div className="input-field">

              <input type="password" name="password" id="password" placeholder="Insira sua senha" />
              <div className="underline"></div>

            </div>
            <div className="submit-login">

              <input type="submit" className="submit-login" />
              <div className="underline"></div>
            </div>
          </form>

        </main></div>

    )
  }


};

export default Signup;
